sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    var successStatusCodes = ['200'];
    var errorMessages = {
      'Project Not Found': 'Project ID not found.'
    };
    var callbackFunction = function(inputs, outputs, errorMessages) {
      outputs.merge_requests = inputs.responseBody;
      return outputs;
    };
    outputs = new x_snc_gitlab.GitLabUtils().postProcess(inputs, outputs, errorMessages, successStatusCodes, callbackFunction);
  } catch (e) {
    outputs = new x_snc_gitlab.GitLabErrorHandler(e).handleError(inputs, outputs, errorMessages);
  }
})(inputs, outputs);

